  - id: 62
    name: Phone Log Follow Up
    description: "Find players by the latest Activity Log recorded, allowing outstanding
      tasks and players requiring follow-up to be found.\r\nIf you need a report of
      all activities performed, not just the latest, use the Reports tab and select
      Phone Log Report.\r\n\r\nAll fields are optional\r\n\r\n* Select the person
      who was calling or who was called\r\n* ... or user name of the user that created
      the Phone Log record\r\n* Include only records where follow up is before a specified
      date\r\n* Include only records where protocol is specified\r\n* Filter results
      by the next step(s) selected"
    sql: "SELECT \r\n  dt.master_id, pi.first_name, pi.last_name, \r\n  follow_up_when,
      \r\n  select_next_step, protocols.name,\r\n  data, select_call_direction, \r\n
      \ select_who, users.email username, \r\n  called_when, select_result\r\nFROM
      (\r\n SELECT \r\n   master_id, \r\n  follow_up_when, data,select_call_direction,
      \r\n  select_who, called_when, select_result, select_next_step, protocol_id,
      user_id,\r\n   rank()\r\n OVER (\r\n  PARTITION BY master_id \r\n  ORDER BY
      called_when DESC, id DESC\r\n ) AS r\r\n FROM activity_log_player_contact_phones\r\n)
      AS dt\r\nINNER JOIN player_infos pi\r\nON pi.master_id = dt.master_id\r\nLEFT
      OUTER JOIN users\r\nON dt.user_id = users.id\r\nLEFT OUTER JOIN protocols\r\nON
      dt.protocol_id = protocols.id\r\nWHERE\r\n  r = 1\r\nAND \r\n  (\r\n    (:next_step)
      IS NULL \r\n    OR select_next_step IN (:next_step)\r\n  )\r\nAND\r\n (:protocol
      IS NULL OR protocol_id = :protocol)\r\nAND\r\n ( \r\n  :select_who IS NULL AND
      :username IS NULL OR \r\n  :select_who IS NOT NULL AND :select_who <> 'user'
      AND select_who = :select_who OR\r\n  :username IS NOT NULL AND dt.user_id =
      :username\r\n )\r\nAND\r\n (:follow_up_before IS NULL OR follow_up_when <= :follow_up_before)\r\nORDER
      BY\r\n  follow_up_when DESC, called_when ASC\r\n;\r\n"
    search_attrs: "select_who: \r\n  general_selection: \r\n    item_type: activity_log__player_contact_phone_select_who\r\n
      \   multiple: single\r\n    label: Filter by named person\r\n\r\n\r\nusername:
      \r\n  user: \r\n    all: true\r\n    multiple: single\r\n    label: or, who
      created the record in Zeus\r\n    default: current_user\r\n\r\nfollow_up_before:
      \r\n  date: \r\n    all: true\r\n    multiple: single\r\n    label: follow up
      before\r\n    default: now\r\nprotocol: \r\n  protocol: \r\n    all: true\r\n
      \   multiple: single\r\n    label: linked to protocol\r\n\r\nnext_step:\r\n
